import { useState, useEffect } from 'react';

const Products: React.FC = () => {
   const [posts, setPosts] = useState([]);

   useEffect(() => {
      fetch('https://jsonplaceholder.typicode.com/posts')
         .then((res) => res.json())
         .then((data) => {
            console.log(data);
            setPosts(data);
         })
         .catch((err) => {
            console.log(err.message);
         });
   }, []);

   return (
      <ul>
         {posts.map(({ id, title }) => (
            <li key={id}>
               {title}
            </li>
         ))}
      </ul>
   );
};

export default Products
